import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Filter } from 'bad-words';
import styles from './styles/sendfeedback.module.css';

const SendFeedback = () => {
  const [email, setEmail] = useState('');
  const [subject, setSubject] = useState('');
  const [message, setMessage] = useState('');
  const [status, setStatus] = useState('');
  const [submitted, setSubmitted] = useState(false);
  const [isLoading, setIsLoading] = useState(false);

  useEffect(() => {
    const params = new URLSearchParams(window.location.search);
    const userEmail = params.get('email');
    setEmail(userEmail);
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (!subject.trim()) {
      setStatus('Subject is required.');
      return;
    }

    if (!message.trim()) {
      setStatus('Please enter a message.');
      return;
    }

    setIsLoading(true);
    const filter = new Filter();
    const cleanedMessage = filter.clean(message);
    const cleanedSubject = filter.clean(subject);

    try {
      const res = await axios.post('http://localhost:5000/api/feedback/send', {
        email,
        subject: cleanedSubject,
        message: cleanedMessage,
      });

      setStatus(res.data.message);
      setSubmitted(true);
    } catch (error) {
      setStatus(error.response?.data?.message || 'Failed to send feedback');
    } finally {
      setIsLoading(false);
    }
  };

  if (!email) {
    return (
      <div className={styles.container}>
        <div className={styles.card}>
          <div className={styles.errorMessage}>
            No recipient email provided in the URL.
          </div>
        </div>
      </div>
    );
  }

  return (
    <div className={styles.container}>
      <div className={styles.card}>
        <h1 className={styles.title}>We appreciate your feedback</h1>
        <p className={styles.subtitle}>Please take a moment to tell us what you think</p>

        <div className={styles.recipientInfo}>
          <span className={styles.recipientLabel}>To: </span>
          <span className={styles.recipientEmail}>{email}</span>
        </div>

        {submitted ? (
          <div className={styles.successContainer}>
            <div className={styles.successIcon}>✓</div>
            <p className={styles.successMessage}>{status}</p>
          </div>
        ) : (
          <form onSubmit={handleSubmit} className={styles.form}>
            <div className={styles.inputGroup}>
              <label htmlFor="subject" className={styles.label}>
                Subject
              </label>
              <input
                id="subject"
                type="text"
                placeholder="Enter subject"
                className={styles.input}
                value={subject}
                onChange={(e) => setSubject(e.target.value)}
              />
            </div>

            <div className={styles.inputGroup}>
              <label htmlFor="message" className={styles.label}>
                Your Feedback
              </label>
              <textarea
                id="message"
                placeholder="What can we do to improve your experience?"
                rows={5}
                className={styles.textarea}
                value={message}
                onChange={(e) => setMessage(e.target.value)}
              />
            </div>

            <button type="submit" className={styles.submitButton} disabled={isLoading}>
              {isLoading ? 'Sending...' : 'Send Feedback'}
            </button>

            {status && <p className={styles.status}>{status}</p>}
          </form>
        )}
      </div>
    </div>
  );
};

export default SendFeedback;
